public class InnerApplicationApplicationConfigurationFactory(Action<Humidifier.KinesisAnalyticsV2.ApplicationTypes.ApplicationConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.KinesisAnalyticsV2.ApplicationTypes.ApplicationConfiguration>
{

    internal InnerApplicationApplicationCodeConfigurationFactory ApplicationCodeConfigurationFactory { get; set; }

    internal InnerApplicationEnvironmentPropertiesFactory EnvironmentPropertiesFactory { get; set; }

    internal InnerApplicationFlinkApplicationConfigurationFactory FlinkApplicationConfigurationFactory { get; set; }

    internal InnerApplicationSqlApplicationConfigurationFactory SqlApplicationConfigurationFactory { get; set; }

    internal InnerApplicationZeppelinApplicationConfigurationFactory ZeppelinApplicationConfigurationFactory { get; set; }

    internal InnerApplicationApplicationSnapshotConfigurationFactory ApplicationSnapshotConfigurationFactory { get; set; }

    internal InnerApplicationApplicationSystemRollbackConfigurationFactory ApplicationSystemRollbackConfigurationFactory { get; set; }

    protected override Humidifier.KinesisAnalyticsV2.ApplicationTypes.ApplicationConfiguration Create()
    {
        var applicationConfigurationResult = CreateApplicationConfiguration();
        factoryAction?.Invoke(applicationConfigurationResult);

        return applicationConfigurationResult;
    }

    private Humidifier.KinesisAnalyticsV2.ApplicationTypes.ApplicationConfiguration CreateApplicationConfiguration()
    {
        var applicationConfigurationResult = new Humidifier.KinesisAnalyticsV2.ApplicationTypes.ApplicationConfiguration();

        return applicationConfigurationResult;
    }
    public override void CreateChildren(Humidifier.KinesisAnalyticsV2.ApplicationTypes.ApplicationConfiguration result)
    {
        base.CreateChildren(result);

        result.ApplicationCodeConfiguration ??= ApplicationCodeConfigurationFactory?.Build();
        result.EnvironmentProperties ??= EnvironmentPropertiesFactory?.Build();
        result.FlinkApplicationConfiguration ??= FlinkApplicationConfigurationFactory?.Build();
        result.SqlApplicationConfiguration ??= SqlApplicationConfigurationFactory?.Build();
        result.ZeppelinApplicationConfiguration ??= ZeppelinApplicationConfigurationFactory?.Build();
        result.ApplicationSnapshotConfiguration ??= ApplicationSnapshotConfigurationFactory?.Build();
        result.ApplicationSystemRollbackConfiguration ??= ApplicationSystemRollbackConfigurationFactory?.Build();
    }

} // End Of Class

